import React, { useState, useEffect } from 'react';
import {
  Button, Table, TableBody, TableCell, TableContainer,
  TableHead, TableRow, Paper, TextField, Dialog, DialogActions,
  DialogContent, DialogTitle, MenuItem
} from '@mui/material';
import * as zimmetServices from '../services/zimmetServices';
import * as envanterServices from '../services/envanterServices';
import * as personelServices from '../services/personelServices';

const ZimmetPage = () => {
  const [zimmetList, setZimmetList] = useState([]);
  const [openDialog, setOpenDialog] = useState(false);
  const [selectedZimmet, setSelectedZimmet] = useState(null);
  const [envanterList, setEnvanterList] = useState([]);
  const [personelList, setPersonelList] = useState([]);
  const [searchParams, setSearchParams] = useState({ sicilNo: '', name: '' });

  const columns = [
    { id: 'personelSicilNo', label: 'Sicil No', minWidth: 170 },
    { id: 'personelName', label: 'Ad', minWidth: 170 },
    { id: 'personelSurname', label: 'Soyad', minWidth: 170 },
    { id: 'personelBirimi', label: 'Birim', minWidth: 170 },
    { id: 'actions', label: 'Actions', minWidth: 170 },
  ];

  useEffect(() => {
    fetchZimmetList();
    fetchEnvanterList();
    fetchPersonelList();
  }, []);

  const fetchZimmetList = () => {
    zimmetServices.getAllZimmet().then(response => setZimmetList(response.data));
  };

  const fetchEnvanterList = () => {
    zimmetServices.getAvailableEnvanter().then(response => setEnvanterList(response.data));
  };

  const fetchPersonelList = () => {
    personelServices.getPersonel().then(response => setPersonelList(response.data));
  };

  const handleSearch = () => {
    zimmetServices.filterPersonel(searchParams.sicilNo, searchParams.name)
      .then(response => setPersonelList(response.data));
  };

  const handleOpenDialog = () => {
    setSelectedZimmet(null);
    setOpenDialog(true);
  };

  const handleCloseDialog = () => {
    setOpenDialog(false);
    setSelectedZimmet(null);
  };

  const handleSubmit = (newZimmet) => {
    zimmetServices.createZimmet(newZimmet).then(() => {
      fetchZimmetList();
      handleCloseDialog();
    });
  };

  const handleGeriAl = (zimmetId) => {
    zimmetServices.geriAlZimmet(zimmetId).then(() => {
      fetchZimmetList();
    });
  };

  return (
    <>
      <TextField
        label="Sicil No"
        value={searchParams.sicilNo}
        onChange={(e) => setSearchParams({ ...searchParams, sicilNo: e.target.value })}
        style={{ margin: '20px' }}
      />
      <TextField
        label="Ad"
        value={searchParams.name}
        onChange={(e) => setSearchParams({ ...searchParams, name: e.target.value })}
        style={{ margin: '20px' }}
      />
      <Button variant="contained" color="primary" onClick={handleSearch} style={{ margin: '20px' }}>
        Ara
      </Button>
      <Button variant="contained" color="primary" onClick={handleOpenDialog} style={{ margin: '20px' }}>
        Yeni Zimmet Ekle
      </Button>

      <TableContainer component={Paper}>
        <Table>
          <TableHead>
            <TableRow>
              {columns.map((column) => (
                <TableCell key={column.id} style={{ minWidth: column.minWidth }}>
                  {column.label}
                </TableCell>
              ))}
            </TableRow>
          </TableHead>
          <TableBody>
            {personelList.map((row) => (
              <TableRow key={row.personelSicilNo}>
                {columns.map((column) => (
                  <TableCell key={column.id}>
                    {column.id === 'actions' ? (
                      <>
                        <Button onClick={() => setSelectedZimmet(row)}>Zimmet İşlemleri</Button>
                      </>
                    ) : (
                      row[column.id]
                    )}
                  </TableCell>
                ))}
              </TableRow>
            ))}
          </TableBody>
        </Table>
      </TableContainer>

      <Dialog open={openDialog} onClose={handleCloseDialog}>
        <DialogTitle>Yeni Zimmet Ekle</DialogTitle>
        <DialogContent>
          <TextField
            select
            label="Envanter"
            fullWidth
            onChange={(e) => setSelectedZimmet({ ...selectedZimmet, envanterId: e.target.value })}
            value={selectedZimmet?.envanterId || ''}
          >
            {envanterList.map((envanter) => (
              <MenuItem key={envanter.id} value={envanter.id}>
                {envanter.tip} - {envanter.markasi} - {envanter.modeli}
              </MenuItem>
            ))}
          </TextField>
          <TextField
            label="Verilme Tarihi"
            type="date"
            fullWidth
            onChange={(e) => setSelectedZimmet({ ...selectedZimmet, verilmeTarihi: e.target.value })}
            value={selectedZimmet?.verilmeTarihi || ''}
            InputLabelProps={{ shrink: true }}
          />
        </DialogContent>
        <DialogActions>
          <Button onClick={handleCloseDialog}>Vazgeç</Button>
          <Button onClick={() => handleSubmit(selectedZimmet)}>Kaydet</Button>
        </DialogActions>
      </Dialog>
    </>
  );
};

export default ZimmetPage;
